import Index from './pages/Index';
import './App.css';
import {BrowserRouter, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path='/'>
          <Index/>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
